local function compute_avg_var_std (v) 
  local n = #v
  if n == 0 then return 0, 0 end
  local sum = 0
  local sum2 = 0
  local x
  for i = 1, n do 
     x = v[i] 
     sum = sum + x
     sum2 = sum2 + x * x
  end
  local avg = sum / n
  local var = (sum2 - sum*sum)  / n
  local std = math.sqrt(var)
  return avg, var, std
end

----------------------------
--
--
--
-----------------------------
local function compute_avg(v) 
  local n = #v
  if n == 0 then return 0 end
  local sum = 0
  for i = 1, n do 
     sum = sum + v[i] 
  end
  return sum / n
end

