-----------------------------
local function compute_pearson(X, Y) 
	local n = #X
	if #Y ~= n then return nil, "err" end

	local avg_x = compute_avg(X)
	local avg_y = compute_avg(Y)
	
	local sum, sum_vx2, sum_vy2 = 0, 0, 0
	local vx, vy
	
	for i = 1, n do 
		sum = sum + (X[i] - avg_x) * (Y[i] - avg_y)
		vx = X[i] - avg_x
		vy = Y[i] - avg_y
		sum_vx2 = sum_vx2 + vx * vx
		sum_vy2 = sum_vy2 + vy * vy
	end
	
	local pearson = sum / ( math.sqrt(sum_vx2) * math.sqrt(sum_vy2) )
	return pearson
end

