local function extract_dts_vals(res) 
	
	if res.tp ~= 6 then return end
	result = res.result
	n = #result
	
	dt_a = {}
	val_a = {}
	for i = 1, n do
		table.insert(val_a,result[i][1])
		table.insert(dt_a,result[i][2])
	end
	return n, dt_a, val_a 
	
end

local day_size = 24 * 3600
local week_size = day_size * 7


-----------------------------
--
--
--
-----------------------------
local function prepare_a_week(dt0, dt1, n, dt_a, val_a)
	local sums_by_day = { 0, 0, 0, 0, 0, 0, 0 } 
	
	for i = 1, n do 
		local dt = dt_a[i] 
		if dt >= dt1 then break end
		if dt >= dt0 then 
			local day = math.floor((dt - dt0) / day_size) + 1
			-- print("Day: ",day, sums_by_day[day], val_a[i])
			sums_by_day[day] = sums_by_day[day]  + val_a[i]
		end
	end
	
	return sums_by_day
end
		


