--
-----------------------------
function do_pearson_weekly(msg1, msg2) 

	-- cria os vetores de tempo e valores para cada resultado
	local n1, dt1_a, val1_a = extract_dts_vals(msg1)
	local n2, dt2_a, val2_a = extract_dts_vals(msg2)
	
	-- acha o menor momento no tempo
	local min_dt = dt1_a[1]
	if dt2_a[1] < min_dt then min_dt = dt2_a[1] end
	
	-- faz o menor tempo ser o inicio de um dia
	min_dt = min_dt - (min_dt % day_size)
		
	-- acha o maior momento no tempo
	local max_dt = dt1_a[n1]
	if dt2_a[n2] > max_dt then max_dt = dt2_a[n2] end

	-- faz o maior tempo ser o inicio do dia após o último dia do intervalo
	max_dt = max_dt - (max_dt % day_size) 
	max_dt = max_dt + day_size
	
	-- print("min max", min_dt, max_dt, max_dt - min_dt )
	
	-- calcula o numero de dias
	local n_days = (max_dt - min_dt) / day_size
	
	-- calcula o numero semanas
	local n_weeks = n_days / 7
	if n_days % 7 > 0 then n_weeks = n_weeks + 1 end
	
	-- prepara o resultado
	local msg = {}
	
	msg.id = msg2.id
	msg.tp = 6
	msg.ms = 0
	msg.result = {}
	
	-- print("N_WEEKS:", n_weeks)
	-- prepara para fazer a correlacao
	local cov
	
	for w = 0, n_weeks - 1 do 
		local dt0 = min_dt + w * week_size
		local dt1 = dt0 + week_size
		
		local days_1 = prepare_a_week(dt0, dt1, n1, dt1_a, val1_a)
		local days_2 = prepare_a_week(dt0, dt1, n2, dt2_a, val2_a)
		
		pearson = compute_pearson(days_1, days_2)
		if pearson < (1.0 - 1.e-17) then 
			print(w, string.format("%.18f",pearson))
			-- for i = 1,7 do print(val1_a[i] - val2_a[i]) end
		end
		local item = {}
		item[1] = w
		item[2] = pearson
		table.insert(msg.result, item)
		
	end
	
	return msg
end

